  return (
    <>
      <Head>
        <link
          rel="stylesheet"
          href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.16.2/antd.css"
        />
        <script src="https://cdnjs.cloudflare.com/ajax/libs/antd/3.16.2/antd.js" />
      </Head>
      <Layout>
        <Sider
          style={{
            overflow: "auto",
            height: "100vh",
            position: "fixed",
            left: 0
          }}
          trigger={null}
          // collapsible
          // collapsed={collapsed}
        >
          <div className="logo" />
          <Menu theme="dark" mode="inline">
            <Menu.Item key="1">
              <Link href="/">
                <a>
                  <Icon type="home" />
                  <span>Home</span>
                </a>
              </Link>
            </Menu.Item>
            <Menu.Item key="2">
              <Link href="/signup">
                <a>
                  <Icon type="user-add" />
                  <span>Register</span>
                </a>
              </Link>
            </Menu.Item>
            <Menu.Item key="3">
              <Link href="/login">
                <a>
                  <Icon type="login" />
                  <span>Login</span>
                </a>
              </Link>
            </Menu.Item>
            <Menu.Item key="4">
              <Link href="/notification">
                <a>
                  <Icon type="notification" />
                  <span>Notification</span>
                </a>
              </Link>
            </Menu.Item>
            <Menu.Item key="5">
              <Link href="/profile">
                <a>
                  <Icon type="user" />
                  <span>MyPage</span>
                </a>
              </Link>
            </Menu.Item>
            <Menu.Item key="6">
              <Link href="/Reservation">
                <a>
                  <Icon type="schedule" />
                  <span>Reservation</span>
                </a>
              </Link>
            </Menu.Item>
            <Menu.Item key="7">
              <Link href="/studyboard">
                <a>
                  <Icon type="read" />
                  <span>StudyBoard</span>
                </a>
              </Link>
            </Menu.Item>
            <Menu.Item key="8">
              <Link href="/questionAnswer">
                <a>
                  <Icon type="check-circle" />
                  <span>Q&A</span>
                </a>
              </Link>
            </Menu.Item>
            <Menu.Item key="9">
              <Link href="/master">
                <a>
                  <Icon type="github" />
                  <span>Master</span>
                </a>
              </Link>
            </Menu.Item>
          </Menu>
        </Sider>
        <Layout style={{ marginLeft: "200px" }}>
          <Header style={{ background: "#fff", padding: 0 }}>
            {/* <Icon
              style={{
                fontSize: "20px",
                padding: "0 20px",
                lineHeight: "64px"
              }}
              type={collapsed ? "menu-unfold" : "menu-fold"}
              onClick={toggle}
            /> */}
            <Link href="/">
              <a>
                <img
                  src="static/images/SWOT_logo.png"
                  style={{
                    float: "right",
                    position: "relative",
                    right: "50%",
                    marginTop: "8px"
                  }}
                ></img>
              </a>
            </Link>
            <Link href="/profile">
              <a>
                <Avatar
                  src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png"
                  style={{
                    float: "right",
                    marginTop: "15px",
                    backgroundColor: "black"
                  }}
                />
              </a>
            </Link>
          </Header>
          <Content
            style={{
              margin: "20px 20px 0",
              padding: 24,
              background: "#fff",
              minHeight: 1000
            }}
          >
            <Component />
          </Content>
          <Footer style={{ textAlign: "center" }}>
            <Row>
              <Col span={12}>
                전화번호 02-2610-4114 <br /> SWOT, 서울특별시 구로구 오류2동
                연동로 320 <br /> Seoul, KR 08359
              </Col>
              <Col span={12}>
                <br />
                저작권 보호 © SWOT Companies Inc. 모든 권리 유보
              </Col>
            </Row>
          </Footer>
        </Layout>
      </Layout>
    </>
  );
};

SWOT.Proptypes = {
  Component: elementType
};

